static bool checkForBfs(size_t x, size_t y, vector<vector<int> > &distance_matrix) {
	if (x < distance_matrix.size()
		&& x >= 0
		&& y < distance_matrix.size()
		&& y >= 0
		) {
		if (distance_matrix[x][y] == -1) {
			return true;
		}

	}
	return false;
}

static bool check(size_t x, size_t y, vector<vector<int> > &board) {
	if (x < board.size()
		&& x >= 0
		&& y < board.size()
		&& y >= 0) {
		return true;
	}
	return false;
}

static map< tuple<int, int>, int > getDistances(tuple<int, int> &init_point, vector<vector<int> > &board, size_t count) {
	map< tuple<int, int>, int > ret;

	size_t n = board.size();
	vector<vector<int> > distance_matrix = vector<vector<int> >(n);
	for (size_t i = 0; i < n; i++) {
		distance_matrix[i] = vector<int>(n, -1);
	}


	queue< tuple<int, int> > queue;
	queue.push(init_point);
	int ix = get<0>(init_point);
	int iy = get<1>(init_point);
	distance_matrix[ix][iy] = 0;

	while (!queue.empty()) {
		tuple<int, int> &point = queue.front();
		queue.pop();

		int x = get<0>(point);
		int y = get<1>(point);

		int value = distance_matrix[x][y];

		if ((board[x][y] == 1 || board[x][y] == 3) && (x != ix || y != iy)) {
			ret[point] = value;
			if (ret.size() >= count) {
				return ret;
			}
		}

		int nValue = value + 1;

		if (checkForBfs(x + 2, y + 1, distance_matrix)) {
			queue.push(make_tuple(x + 2, y + 1));
			distance_matrix[x + 2][y + 1] = nValue;
		}
		if (checkForBfs(x + 1, y + 2, distance_matrix)) {
			queue.push(make_tuple(x + 1, y + 2));
			distance_matrix[x + 1][y + 2] = nValue;
		}
		if (checkForBfs(x + 2, y - 1, distance_matrix)) {
			queue.push(make_tuple(x + 2, y - 1));
			distance_matrix[x + 2][y - 1] = nValue;
		}
		if (checkForBfs(x + 1, y - 2, distance_matrix)) {
			queue.push(make_tuple(x + 1, y - 2));
			distance_matrix[x + 1][y - 2] = nValue;
		}
		if (checkForBfs(x - 2, y + 1, distance_matrix)) {
			queue.push(make_tuple(x - 2, y + 1));
			distance_matrix[x - 2][y + 1] = nValue;
		}
		if (checkForBfs(x - 1, y + 2, distance_matrix)) {
			queue.push(make_tuple(x - 1, y + 2));
			distance_matrix[x - 1][y + 2] = nValue;
		}
		if (checkForBfs(x - 2, y - 1, distance_matrix)) {
			queue.push(make_tuple(x - 2, y - 1));
			distance_matrix[x - 2][y - 1] = nValue;
		}
		if (checkForBfs(x - 1, y - 2, distance_matrix)) {
			queue.push(make_tuple(x - 1, y - 2));
			distance_matrix[x - 1][y - 2] = nValue;
		}
	}

	return ret;
}


static bool isOnEdge(tuple<int, int> &a, size_t &size) {
	int x = get<0>(a);
	int y = get<1>(a);
	return (x == 0 || y == 0 || x == size - 1 || y == size - 1);
}

static int distanceTuple(tuple<int, int> &a, tuple<int, int> &b, size_t &size) {
	int x = abs(get<0>(a) - get<0>(b));
	int y = abs(get<1>(a) - get<1>(b));
	if (isOnEdge(a, size) || isOnEdge(b, size)) {
		return distances_corner[x][y];
	}
	return distances_normal[x][y];
}


static vector<vector<int>> loadBoard(const char* file) {
	cout << file << " : ";
	ifstream infile;
	infile.open(file);
	string line;

	getline(infile, line);

	stringstream ss(line);
	string item;
	vector<string> first;
	while (getline(ss, item, ' ')) {
		const string cItem(item);
		first.push_back(cItem);
	}

	int board_size = stoi(first[0]);

	vector<vector<int> > board = vector<vector<int> >(board_size);
	for (int i = 0; i < board_size; i++) {
		board[i] = vector<int>(board_size);
	}

	int row = 0;
	while (getline(infile, line))
	{
		int i = 0;
		for (char& c : line) {
			board[row][i++] = (int)c - '0';
		}
		row++;
	}
	infile.close();

	return board;
}

/*
*Return list of points where point on index 0 is starting point
*/
static vector<tuple<int, int> > loadPoints(vector<vector<int>> board) {
	vector<tuple<int, int> > tmp_points;
	tuple<int, int> start;
	for (int i = 0; i < static_cast<int>(board.size()); i++) {
		for (int j = 0; j < static_cast<int>(board.size()); j++) {
			if (board[i][j] == 1) {
				tmp_points.push_back(make_tuple(i, j));
			}
			else if (board[i][j] == 3) {
				start = make_tuple(i, j);
			}
		}
	}

	vector<tuple<int, int> > points;
	points.push_back(start);
	for (size_t i = 0; i < tmp_points.size(); i++) {
		points.push_back(tmp_points[i]);
	}

	return points;
}

static vector<vector<int>> getDistanceMatrix(vector<vector<int> > &board, vector<tuple<int, int> > points) {
	int b_s = static_cast<int>(board.size());
	int s = static_cast<int>(points.size());

	vector<vector<int> > distance_matrix = vector<vector<int> >(s);
	for (size_t i = 0; i < s; i++) {
		distance_matrix[i] = vector<int>(s);
	}


	for (size_t i = 0; i < s; i++) {
		map<tuple<int, int>, int> distances = getDistances(points[i], board, s);
		for (size_t j = i; j < s; j++) {
			if (i == j) {
				distance_matrix[i][j] = 0;
			}
			else {
				distance_matrix[i][j] = distance_matrix[j][i] = distances[points[j]];
			}
		}
	}
	return distance_matrix;
}

static tuple<long, vector<int>> permute(vector<int> init_poition, vector<vector<int>> distance_matrix, int imutable) {
	long best_distance = numeric_limits<long>::max();
	vector<int> best_order;
	auto perm = init_poition;
	do {
		long ret = distance_matrix[0][perm[0]];
		for (int j = 0; j < perm.size() - 1; j++) {
			ret += distance_matrix[perm[j]][perm[j + 1]];
			if (ret > best_distance) {
				break;
			}
		}
		if (ret < best_distance) {
			best_distance = ret;
			best_order = vector<int>(perm);
		}
	} while (next_permutation(perm.begin() + imutable, perm.end()));

	return make_tuple(best_distance, best_order);
}

