static void work(const char* file) {
	clock_t begin = clock();
	vector<vector<int> > board;
	vector<tuple<int, int> > points;
	vector<vector<int>> distance_matrix;
	vector<int> best_order;
	int point_count = 0;
	int best_distance = numeric_limits<int>::max();

	if (proc_number == 0) {
		/*
		 * THE MASTERMIND OF THE OPERATION. ENSLAVING THE OTHER PROCESS BUT IN THE FAIR MANNER
		 */
		board = loadBoard(file);
		points = loadPoints(board);
		distance_matrix = getDistanceMatrix(board, points);
		point_count = static_cast<int>(points.size());

		vector<int> indexes;
		for (int i = 1; i < point_count; i++) {
			indexes.push_back(i);
		}

		MPI_Barrier(MPI_COMM_WORLD);
		MPI_Bcast(&point_count, 1, MPI_INT, 0, MPI_COMM_WORLD);

		for (int i = 0; i < point_count; i++) {
			for (int j = 0; j < point_count; j++) {
				MPI_Bcast(&distance_matrix[i][j], 1, MPI_INT, 0, MPI_COMM_WORLD);
			}
		}

		//generate even parts of problem by swaping the firs element
		map<int, int> counter;
		for (int i = 0; i < indexes.size(); i++) {
			auto perm = indexes;
			rotate(perm.begin(), perm.begin() + i, perm.begin() + i + 1);
			int process =(i % (proc_count-1))+1;
			cout << "sending to process:" << process << endl;	
			for (int j = 0; j < indexes.size(); j++) {
				MPI_Send(&perm[j], 1, MPI_INT, process, 0, MPI_COMM_WORLD);
			}

			counter[process]++;
		}
		
		MPI_Status status;
		int temp_best_distance;
		int do_stuff_all = 1;
		int do_not_do_stuff = 0;
		for (int i = 0; i < indexes.size(); i++) {
			MPI_Recv(&temp_best_distance, 1, MPI_INT, MPI_ANY_SOURCE, 8, MPI_COMM_WORLD, &status);	
			vector<int> temp_best_order;
			int temp_index;
			for (int j = 0; j < indexes.size(); j++) {
				MPI_Recv(&temp_index, 1, MPI_INT, status.MPI_SOURCE, 7, MPI_COMM_WORLD, MPI_STATUS_IGNORE);
				temp_best_order.push_back(temp_index);
			}
			if (temp_best_distance < best_distance) {
				cout << "best dist is now:" << temp_best_distance << endl;
				best_distance = temp_best_distance;
				best_order = temp_best_order;
			}

			counter[status.MPI_SOURCE]--;

			if (counter[status.MPI_SOURCE] > 0) {
				MPI_Send(&do_stuff_all, 1, MPI_INT, status.MPI_SOURCE, 4, MPI_COMM_WORLD);
			}else {
				cout << "terminating : " << status.MPI_SOURCE << endl;
				MPI_Send(&do_not_do_stuff, 1, MPI_INT, status.MPI_SOURCE, 4, MPI_COMM_WORLD);
			}
		}

		cout << "!!!! Final best distance:" << best_distance << " v:";
		for (int i = 0; i < best_order.size(); i++) {
			cout << best_order[i] << ',';
		}
		cout << endl;
		
		reconstructPath(points, best_order, board, best_distance);
	}
	else {
		/*
		 *SLAVE WORKER THE PERFECT SHOVEL OF THE PERMUTATION TOIL
		 */
		best_distance = numeric_limits<int>::max();
		MPI_Barrier(MPI_COMM_WORLD);
		MPI_Bcast(&point_count, 1, MPI_INT, 0, MPI_COMM_WORLD);
		distance_matrix = vector<vector<int> >(point_count);
		for (size_t i = 0; i < point_count; i++) {
			distance_matrix[i] = vector<int>(point_count);
		}
		for (int i = 0; i < point_count; i++) {
			for (int j = 0; j < point_count; j++) {
				MPI_Bcast(&distance_matrix[i][j], 1, MPI_INT, 0, MPI_COMM_WORLD);
			}
		}
		
		int do_stuff = 1;
		while (do_stuff==1) {
			vector<int> indexes;
			for (int i = 0; i < (point_count - 1); i++) {
				int val;
				MPI_Recv(&val, 1, MPI_INT, 0, 0, MPI_COMM_WORLD,MPI_STATUS_IGNORE);
				indexes.push_back(val);
			}

			cout << "p:" << proc_number << " start working on :";
			for (int i = 0; i < indexes.size(); i++) {
				cout << indexes[i] << ',';
			}
			cout << endl;
			//second level p
			#pragma omp parallel for num_threads(4)
			for (int i = 0; i < indexes.size()-1 ; ++i) {
				auto perm = indexes;
				rotate(perm.begin()+1, perm.begin()+(i+1), perm.begin()+(i+2));
				#pragma omp critical(best_order)
				{
					cout <<"pr:" << proc_number << " thr:"<< omp_get_thread_num() << " : ";
					for (int j = 0; j < perm.size(); j++) {
						cout << perm[j] << ',';
					}
					cout << endl;
				}
				
				do {
					int ret = distance_matrix[0][perm[0]];
					for (int j = 0; j < indexes.size() - 1; j++) {
						ret += distance_matrix[perm[j]][perm[j + 1]];
						if (ret > best_distance) {
							break;
						}
					}
					#pragma omp critical(best_order)
					if (ret < best_distance) {
						best_distance = ret;
						best_order = vector<int>(perm);
					}
					//permutate all except first element which is fixed
				} while (next_permutation(perm.begin() + 2, perm.end()));
			}
			cout << "p:" << proc_number << " Finish working:" << best_distance << endl;
			MPI_Send(&best_distance, 1, MPI_INT, 0, 8, MPI_COMM_WORLD);
			for (int i = 0; i < best_order.size(); i++) {
				MPI_Send(&best_order[i], 1, MPI_INT, 0, 7, MPI_COMM_WORLD);
			}

			MPI_Recv(&do_stuff, 1, MPI_INT, 0, 4, MPI_COMM_WORLD, MPI_STATUS_IGNORE);
		}
		cout << "p:" << proc_number << " Terminated" << endl;
	}
	return;
	
	
	
	/*
	if (proc_number == 0) {
	
	}*/

}



